import java.math.BigInteger;

public class RecursiveDigitSum {
	public static void main(String[] args) {
		System.out.println(superDigit("", 4));
	}
	
	 static int superDigit(String n, int k) {

	        BigInteger sum=new BigInteger("0");
	        BigInteger x=new BigInteger(n);
	        BigInteger y=new BigInteger(k+"");
	        
	        while(x.compareTo(BigInteger.ZERO)!=0)
	        {
	        	BigInteger rem=x.remainder(BigInteger.TEN);
	            sum=sum.add(rem);
	            x=x.divide(BigInteger.TEN);
	        }
	        
	        BigInteger res=sum.multiply(y);
	        BigInteger ans=superp(res);
	        int a=Integer.parseInt(ans.toString());
	        
	        return a;

	    }

	    public static BigInteger superp(BigInteger x)
	    {
	        if(x.divide(BigInteger.TEN).compareTo(BigInteger.ZERO)==0)
	            return x;
	        
	        BigInteger sum=new BigInteger("0");
	        while(x.compareTo(BigInteger.ZERO)!=0)
	        {
	        	BigInteger rem=x.remainder(BigInteger.TEN);
	            sum=sum.add(rem);
	            x=x.divide(BigInteger.TEN);
	        }

	        BigInteger rr=superp(sum);
	        return rr;

	    }
}
